import React, { Component } from 'react';
import Layout from './../layouts/MainLayout';
import { GoogleLogin } from 'react-google-login';
import SubNavBar from './../layouts/SubNavbar';
import SignUp from './../components/signup';
class Index extends Component {

  componentDidMount= ()=> {
    this.showsignup();
  }
  showsignup(){
    this.refs.child.showsignup();
  }

 
  
render(){
      //side navbar link
      const sidenavlink = [
        {id:1,link:'/',linkname:'home'},
        {id:1,link:'/menu',linkname:'menu'},

      ];
      
        const sidenavconst = {topic : 'Categeries',topiclink:'All ',sidenavlink:sidenavlink};
  return(
<Layout>
<SubNavBar sidenavconst={sidenavconst}/>
<button onClick={this.showsignup.bind(this)} >click</button>
<SignUp ref="child" showsignup={this.props.showsignup} />

</Layout>
  )
}
 
}



export default Index;
